(6196, 732, '_elementor_data', '[{\"id\":\"cad8b9e\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"8ce9240\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"0b60589\",\"elType\":\"widget\",\"settings\":{\"title\":\"Our Story\",\"header_size\":\"h1\",\"align\":\"center\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"16e4be2\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"cdf3f1a\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"9bd1b68\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Hello and welcome to PrintGlobal.<\\/p><p>We are proud to cater to our growing customer base every day. What started as a modest digital firm has evolved over the years into a large-scale litho printing company offering wide-ranging services including flyers, business cards, business stationery, booklets and brochures, folders, signage, banners. At Print World, we have always endeavour to remain at the top of business through our dedication, sincerity, and honesty towards the diverse services we provide to our customers.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"5b10b8a\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"20f1fdd\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"b9144f8\",\"elType\":\"widget\",\"settings\":{\"title\":\"Our Mission\",\"align\":\"center\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"4072da7\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"4cbf639\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"6a2224c\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Right from the beginning, our only goal is to build a lasting relationship with our clients through Honesty, Reliability, Professionalism and 