(732, 1, '2019-01-27 13:03:19', '2019-01-27 13:03:19', '<h1>Our Story</h1>\nHello and welcome to PrintGlobal.\n\nWe are proud to cater to our growing customer base every day. What started as a modest digital firm has evolved over the years into a large-scale litho printing company offering wide-ranging services including flyers, business cards, business stationery, booklets and brochures, folders, signage, banners. At Print World, we have always endeavour to remain at the top of business through our dedication, sincerity, and honesty towards the diverse services we provide to our customers.\n<h2>Our Mission</h2>\nRight from the beginning, our only goal is to build a lasting relationship with our clients through Honesty, Reliability, Professionalism and Ethical Business Practices.\n\nWe achieve that by acting as experts, helping, guiding and interacting with our customers offering best printing and design solutions.\n\nOur key focus is to offer professional products and services at affordable prices. &nbsp;That’s why we produce everything in-house, allowing us to control the entire process and deliver uncompromised and exceptional value.', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2019-01-27 13:08:08', '2019-01-27 13:08:08', '', 0, 'http://localhost/?page_id=732', 0, 'page', '', 0),
