(750, 1, '2019-01-27 13:39:56', '2019-01-27 13:39:56', '<h2>PVC Banners a High Impact Advertising!</h2>		\n		<p>Banners are conceivably the most time-tested form of advertising in the world.<br />Placing colourful, eye-catching banners in key locations will direct customers to your premises, and promote your business<br />They don’t just work - they get exceptional results</p>		\n			<h2>PVC Banner a Weatherproof and durable solution </h2>		\n		<p>The most common uses of banners are outdoors, which means the biggest threat to its lifespan is the weather.<br />We provide high-quality full-colour PVC banners with eyelets and guarantee no fading so that your banner looks great and lasts longer against the effects of rain, wind or snow</p>		\n			<h2>PVC Banners are adaptable</h2>		\n		<p>PVC material and is best suited for advertising banners, event banners, large and wide PVC banners, temporary shop signage and is suitable for use both indoors and outdoors</p>		\n			<h2>Immediate and customised service</h2>		\n		<p>Our PVC banners come in a number of sizes but we print custom banners. We offer some of the fastest printing turnaround times found online. With our 1-day turnaround option, you can have your product printed and shipped within 24 hours* <br />For Cardiff Area, we will deliver the banners in person assuring a timely delivery</p>', 'Banners', '', 'publish', 'closed', 'closed', '', 'banners', '', '', '2019-02-08 19:15:30', '2019-02-08 19:15:30', '', 0, 'http://localhost/?page_id=750', 0, 'page', '', 0),
