(780, 1, '2019-01-28 18:07:23', '2019-01-28 18:07:23', 'Foamex\r\n\r\nA solid and strong, yet lightweight material which is extremely versatile.', 'Foamex', 'Foamex is a PVC board which are rigid and durable whilst still being lightweight and flexible. They are extremely popular for use in signage, point of sale, crafts, artwork display and model making\r\n\r\nFoamex board has a smooth surface which makes which means we can print on either side making it a cost effective display solution.\r\n\r\nOur Foamex boards come in 3mm and 5mm thicknesses, design, printed and cut to your size requirements. To ensure best quality we print onto self-adhesive vinyl and applied to the foamex\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nSpecifications\r\n<ul>\r\n 	<li>Digitally printed applied self-adhesive</li>\r\n 	<li>Printed on either 3mm or 5mm rigid foamex</li>\r\n 	<li>Trimmed sides as standard</li>\r\n 	<li>Lightweight and easy to install</li>\r\n 	<li>Flexible and durable, can be stuck, screwed, nailed or riveted to any suitable surface</li>\r\n 	<li>Suitable for both indoor and outdoor use</li>\r\n 	<li>Maximum size 2.4m × 1.2m (8ft × 4ft approx.) in one piece</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'foamex', '', '', '2019-02-03 17:49:02', '2019-02-03 17:49:02', '', 0, 'http://localhost/?post_type=product&#038;p=780', 0, 'product', '', 0),
(782, 1, '2019-01-28 18:18:48', '2019-01-28 18:18:48', 'The affordable solution for your display needs, pull up roller banners provide high quality at a low cost. As effective on the shop floor as at your next industry event', 'Roller Banner', 'Roller banners or pull up banners are a low-cost solution for your display needs. They are quick to set up, easy and light to transport making them a perfect display solution essential tool for making a statement at exhibitions, trade shows, showrooms, events, presentations or product launches. All our stands are supplied with a quality guarantee.', 'publish', 'open', 'closed', '', 'roller-banner', '', '', '2019-02-03 17:57:15', '2019-02-03 17:57:15', '', 0, 'http://localhost/?post_type=product&#038;p=782', 0, 'product', '', 0),
