(67, 67, 'product_cat', 'PVC Banners a High Impact Advertising!\r\nBanners are conceivably the most time-tested form of advertising in the world.\r\nPlacing colourful, eye-catching banners in key locations will direct customers to your premises, and promote your business\r\nThey don’t just work - they get exceptional results \r\n \r\nPVC Banner a Weatherproof and durable solution \r\nThe most common uses of banners are outdoors, which means the biggest threat to its lifespan is the weather.\r\nWe provide high-quality full-colour PVC banners with eyelets and guarantee no fading so that your banner looks great and lasts longer against the effects of rain, wind or snow\r\n \r\nPVC Banners are adaptable\r\nPVC material and is best suited for advertising banners, event banners, large and wide PVC banners, temporary shop signage and is suitable for use both indoors and outdoors\r\n \r\n \r\n \r\nImmediate and customised service\r\nOur PVC banners come in a number of sizes but we print custom banners. We offer some of the fastest printing turnaround times found online. With our 1-day turnaround option, you can have your product printed and shipped within 24 hours*  \r\nFor Cardiff Area, we will deliver the banners in person assuring a timely delivery\r\n', 0, 3),
